import React, { useState } from "react";
import axios from "axios";

const TextToImage = () => {
  const [prompt, setPrompt] = useState("");
  const [imageUrl, setImageUrl] = useState("");
  const [loading, setLoading] = useState(false);
  const API_KEY = "YOUR_FALL_AI_API_KEY"; // Replace with your Fall AI API key

  const generateImage = async () => {
    if (!prompt) return alert("Please enter a prompt!");
    setLoading(true);

    try {
      const response = await axios.post(
        "https://api.fallai.com/generate", // Use Fall AI's actual endpoint
        {
          prompt: prompt,
          model: "stable-diffusion", // Adjust based on Fall AI's supported models
        },
        {
          headers: {
            Authorization: `Bearer ${API_KEY}`,
            "Content-Type": "application/json",
          },
        }
      );

      setImageUrl(response.data.image_url); // Adjust based on API response structure
    } catch (error) {
      console.error("Error generating image:", error);
      alert("Failed to generate image. Check your API key and prompt.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="container">
      <h2>Text-to-Image Generator</h2>
      <input
        type="text"
        placeholder="Enter your prompt..."
        value={prompt}
        onChange={(e) => setPrompt(e.target.value)}
      />
      <button onClick={generateImage} disabled={loading}>
        {loading ? "Generating..." : "Generate Image"}
      </button>

      {imageUrl && (
        <div>
          <h3>Generated Image:</h3>
          <img src={imageUrl} alt="Generated" width="300" />
        </div>
      )}
    </div>
  );
};

export default TextToImage;
